    mainBox: {
        width: '100%',
        display: 'flex',
        justifyContent:'space-around'
    },
    inBox:{
        background:'white',
        border:'1px solid red',

    },
    imageBox: {
        padding:'5px auto',
        "& img":{
            maxWidth:'100%',
            height:'100%'
        }
    },
    textBox: {

    }

}))

export function NewPosCards({
    data
}) {
    const classes = useStyles()
    return (
        <>
            <MainContainer>
                <Container>
                    <Box className={classes.mainBox}>
                        {
                            data.map((item, index) => {
                                return (
                                    <Box className={classes.inBox}>
                                        <Box className={classes.imageBox}>
                                            <img src={item.images} />
                                        </Box>
                                        <Paragraphs
                                            // title="sfdsf"
                                            // subhead="sdfsfdsf"
                                            // subhead2="sdsd"
                                        />

                                    </Box>
                                )
                            })
                        }
                    </Box>
                </Container>
            </MainContainer>
        </>
    )
}
